description:
OSB-ul este o placa rigida triplu stratificata, alcatuita din 3 straturi de aschii de lemn cu orientare ortogonala (intretesuta), incleiate si presate printr-un proces de presare continua la cald.
  Utilizarea placilor OSB este multipla, pe langa aplicatiile cu rol structural la constructiile pe structura de lemn (realizarea de plansee, pardoseli, pereti sau astereli), produsul putand fi utilizat si la o serie intreaga de aplicatii conexe, precum:
realizarea de cofraje pentru beton;
realizarea de rafturi;
realizarea de constructii temporare usoare (baraci, organizari de santier, soproane, magazii);
inchideri temporare de santier;
scene, strapontine;
panouri de afisaj.
  Fixarea placilor de suporti:
  Datorita orientarii speciale a aschiilor din straturile de mijloc si suprafata, placile OSB prezinta o particularitate din punct de vedere al comportamentului mecanic: rezistenta la incovoiere si rigiditatea din incovoiere (modulul de elasticitate) a placilor este de circa 2,5 mai mare pe axa principala (axa de rezistenta), comparativ cu cea secundara. Pentru identificare usoara, axa principala e data de lungimea placii, iar cea secundara se afla pe latimea acesteia.
In cazul podelelor si asterelilor, placile trebuie dispuse si montate cu latura lunga perpendicular pe reazeme (grinzi, capriori), respectiv cu cea scurta fixata pe suporti.
Imbinarile in cruce trebuie evitate. Pentru aceasta, placile trebuie decalate cu minim 40 cm intre randurile adiacente ale panotajului. In cazul placarilor de pereti, rigiditatea maxima se obtine cand placile sunt montate in pozitie verticala.
Pe langa remarcabila rezistenta la incovoiere si forfecare, OSB-ul are si o foarte buna stabilitate dimensionala in conditii de umiditate. Este alegerea ideala pentru realizarea panotajelor cu rol portant, in cazul constructiilor pe structura din lemn.
Alegerea grosimii placilor:
Grosimea placilor OSB folosite ca panotaje cu rol portant depinde de marimea sarcinii ce trebuie preluate, de sectiunea si/sau de deschiderea dintre suporti. Producatorul recomanda urmatoarele grosimi minime ale placilor OSB 3 pentru deschideri tip de 625 mm intre suporti (montanti, grinzi, capriori):
perete interior: minim 10 mm;
perete exterior: minim 12 mm, ideal 15 mm;
planseu rezidential: minim 18 mm, ideal 22 mm;
acoperis: minim 22 mm.
  Conditii de depozitare:
  In general, pe perioada transportului, depozitarii, executiei si exploatarii constructiei, o atentie deosebita trebuie acordata evitarii contactului direct cu apa si limitarii absorbtiei de umiditate in placa. Placile OSB sunt produse proiectate sa performeze optim in conditii de mediu uscat sau umed, deci expunerea directa a acestora la intemperii (neprotejate la mediul exterior) nu este permisa.

KleverBoard este o placa multifunctionala OSB 3, cel mai avansat tip de OSB disponibil in prezent, dezvoltat si fabricat in deplina conformitate cu tendintele actuale, asociate cu un stil de viata ecologic, bazat pe materiale organice.
Folosind lemn si adeziv adecvat (fara formaldehida), OSB 3 indeplineste cele mai exigente standarde in materie de constructii si amenajari. Placa rigida triplustratificata este alcatuita din 3 straturi de aschii de lemn cu orientare ortogonala (intretesuta), incleiate si presate printr-un proces de presare continua la cald.
Caracteristici:
rezistenta imbunatatita la conditiile de umiditate;
capacitate portanta si rigiditate mare in scopuri de constructii;
exactitate si stabilitate dimensionala ridicata;
flexibilitate si rezistenta superioara la impact;
prelucrare usoara cu scule obisnuite de prelucrare a lemnului;
produs ecologic, reciclabil.
Placile KleverBoard pot fi utilizate in diferite domenii si pentru multiple tipuri de activitati, precum:
realizarea de cofraje pentru beton;
realizarea de rafturi;
realizarea de constructii temporare usoare (baraci, organizari de santier, soproane, magazii);
inchideri temporare de santier;
scene, strapontine;
panouri de afisaj;
aplicatii structurale: pereti, pardoseli, acoperisuri, scari, imprejmuiri;
elemente de mobilier, elemente decorative in spatii interioare, cadre pentru mobilier tapitat, panouri de usi, placari si compartimentari;
ambalaje: cutii si containere pentru transport, paleti;
spatii de vanzare cu amanuntul si de expunere;
sisteme de gestiune a depozitelor (rafturi, stelaje etc.).
Produsul se comercializeaza la bucata. O placa OSB 3 KleverBoard are dimensiunea de 1820 x 600 x 11 mm.

