Acesta poate fi utilizat in diferite domenii, precum:
design interior;
scari interioare;
tamplarie;
mobilier;
constructii.
Panourile sunt calibrate, slefuite, si se livreaza individual, grupat pe palet, cu protectie exterioara. 
Se recomanda aplicarea unui finisaj de acoperire pentru protectia acestora pe termen lung.

