KleverBoard este o placa multifunctionala OSB 3, cel mai avansat tip de OSB disponibil in prezent, dezvoltat si fabricat in deplina conformitate cu tendintele actuale, asociate cu un stil de viata ecologic, bazat pe materiale organice.
Folosind lemn si adeziv adecvat (fara formaldehida), OSB 3 indeplineste cele mai exigente standarde in materie de constructii si amenajari. Placa rigida triplustratificata este alcatuita din 3 straturi de aschii de lemn cu orientare ortogonala (intretesuta), incleiate si presate printr-un proces de presare continua la cald.
Caracteristici:
rezistenta imbunatatita la conditiile de umiditate;
capacitate portanta si rigiditate mare in scopuri de constructii;
exactitate si stabilitate dimensionala ridicata;
flexibilitate si rezistenta superioara la impact;
prelucrare usoara cu scule obisnuite de prelucrare a lemnului;
produs ecologic, reciclabil.
Placile KleverBoard pot fi utilizate in diferite domenii si pentru multiple tipuri de activitati, precum:
realizarea de cofraje pentru beton;
realizarea de rafturi;
realizarea de constructii temporare usoare (baraci, organizari de santier, soproane, magazii);
inchideri temporare de santier;
scene, strapontine;
panouri de afisaj;
aplicatii structurale: pereti, pardoseli, acoperisuri, scari, imprejmuiri;
elemente de mobilier, elemente decorative in spatii interioare, cadre pentru mobilier tapitat, panouri de usi, placari si compartimentari;
ambalaje: cutii si containere pentru transport, paleti;
spatii de vanzare cu amanuntul si de expunere;
sisteme de gestiune a depozitelor (rafturi, stelaje etc.).
Produsul se comercializeaza la bucata. O placa OSB 3 KleverBoard are dimensiunea 2440 x 600 x 9 mm.

Panoul incleiat, din lemn, se compune din lamele de aceeasi esenta lemnoasa (molid), dintr-o bucata, incleiate intre ele si dispuse paralel cu cantul lung.
Lamelele au latimea de 30 - 50 mm si formeaza un placa de 2000 x 200 x 18 mm (Lxlxh).
Folosirea molidului la fabricarea panoului atrage dupa sine avantaje, precum:
umflare - contragere constanta;
densitate mica in raport cu proprietatile fizico - mecanice;
rezistenta mecanica foarte buna;
inele anuale fine si culoare uniforma.
  Acest tip de panou este destinat utilizarii in domeniul tamplariei.

