Placile OSB Nut & Feder pentru pardoseli sunt concepute special pentru domeniul constructiilor. Datorita imbinarii precise a profilului, placile Nut & Feder pot fi folosite pentru o pardosire uscata, curata si rapida.
Solutia ideala pentru panotari fara probleme.
Desi relativ putin cunoscute – si deci, utilizate – in Romania, placile OSB cu Nut si Feder (N&F) prezinta multiple avantaje in cazul utilizarii ca plansee structurale, pardoseli flotante sau astereli.
Sa le amintim pe scurt:
Placile N&F au un rost de dilatatie de 1 mm incorporat din fabricatie pe fiecare latura. Prin urmare, in cazul folosirii acestora, viteza de executie creste, intrucat nu se mai pierde timp pretios cu trasarea si alinierea rosturilor ca in cazul placilor cu muchie dreapta;
  Datorita efectului de saiba rigida rezultat din modul de interconectare al muchiilor, placile N&F necesita doar ca latura lor scurta sa fie fixata pe suporti (grinzi/capriori). Astfel, nu mai este necesara existenta unor reazeme suplimentare pentru sustinerea laturilor lungi ca in cazul placilor cu muchie dreapta, ceea ce duce la o economie semnificativa de material si manopera;
  Suprafetele suport rezultate din imbinarea placilor N&F sunt perfect plane, putandu-se astfel trece la instalarea imediata a stratului de finisaj – de exemplu, a parchetului laminat, gresiei sau mochetei. In cazul utilizarii placilor cu muchie dreapta, probabilitatea existentei unor usoare neplaneitati intre placi este destul de mare, si aceasta trebuie obligatoriu corectata inainte de aplicarea pardoselii;
  Aceeasi suprafata perfect plana permite si montajul fara probleme al sindrilei bituminoase, iar in cazul invelitorilor de tip tigla sau tabla, al foliei anticondens direct peste astereala, fara risc de perforare al acesteia.

